import React from 'react';
import BrandMenu from '../components/BrandMenu';

// import Dosist from 'front-end/src/photo_assets/Brands/Dosist.png';
import Houseplant from 'front-end/src/photo_assets/Brands/Houseplant.png';
import Kurvana from 'front-end/src/photo_assets/Brands/Kurvana.png';
import LeafsBySnoop from 'front-end/src/photo_assets/Brands/LeafsBySnoop.png';
import Level from 'front-end/src/photo_assets/Brands/Level.png';
import LowellFarms from 'front-end/src/photo_assets/Brands/LowellFarms.png';
import MarleyNatural from 'front-end/src/photo_assets/Brands/LowellFarms.png';
import Monogram from 'front-end/src/photo_assets/Brands/Monogram.png';
import WillysReserve from 'front-end/src/photo_assets/Brands/Willys_Reserve.png';

brandPhotos = [
    {imageSrc: Dosist, alt: 'Dosist'},
    {imageSrc: Houseplant, alt: 'Houseplant'},
    {imageSrc: Kurvana, alt: 'Kurvana'},
    {imageSrc: LeafsBySnoop, alt: 'Leafs By Snoop'},
    {imageSrc: Level, alt: 'Level'},
    {imageSrc: LowellFarms, alt: 'Lowell Farms'},
    {imageSrc: MarleyNatural, alt: 'Marley Natural'},
    {imageSrc: Monogram, alt: 'Monogram'},
    {imageSrc: WillysReserve, alt: 'Willy\'s Reserve'},  
]

const Brands = () => {
    return (
        <div >
            <BrandMenu brandPhotos={brandPhotos} />
        </div>
    )
};

export default Brands;
